import ColumnFilter from './Coloumnfilter'
export const COLUMN=[
    {
        Header:'Id',
        Footer:'id',
        accessor:'id',
        Filter:ColumnFilter
    },
    {
        Header:'FirstName',
        Footer:'FirstName',
        accessor:'first_name',
        Filter:ColumnFilter
    },
    {
        Header:'Last Name',
        Footer:'Last Name',
        accessor:'last_name',
        Filter:ColumnFilter
    },
    {
        Header:'Email',
        Footer:'Email',
        accessor:'email',
        Filter:ColumnFilter
    },
    {
        Header:'Gender',
        Footer:'Gender',
        accessor:'gender',
        Filter:ColumnFilter
    },
    {
        Header:'Age',
        Footer:'Footer',
        accessor:'age',
        Filter:ColumnFilter
    },
    

]
